    topic.value = options.topic
    uni.request({
      url: 'https://dida.012331.com/find/story/',
      method: 'POST',
      data: {
        body: body.value,
        color: color.value,
        topic: topic.value,
      },
      success: (res) => {
        const data = res.data.data;
        story_list.value = data;

        if (story_list.value.length > 0 && story_list.value[0].content) {
          story_content.value = story_list.value[0].content;
          storyid.value = story_list.value[0].storyid;

          uni.request({
            url: 'https://dida.012331.com/get/story/collected/',
            method: 'POST',
            data: {
              openid: uni.getStorageSync('openid'),
              storyid: storyid.value,
            },
            success: (res) => {
              const data = res.data.data;
              if (data === 'True') {
                collected.value = true
              } else if (data === 'False') {
                collected.value = false
              }
            },
            fail: (err) => {
              console.error('请求失败', err);
            }
          })

          title.value = story_list.value[0].title;
          story_title.value = '3分钟故事 . ' + title.value;
          tail_centent.value = '和你的孩子一起讨论一下吧!';
          paragraphs.value = story_list.value[0].content.split('___');
          paragraphs.value = paragraphs.value.map(paragraph => paragraph.trim());
          console.log(paragraphs.value);
        } else {
          story_content.value = '暂无内容！'
          tail_centent.value = '试试查看别的故事吧!';
          paragraphs.value = story_content.value.split('\n');
          paragraphs.value = paragraphs.value.map(paragraph => paragraph.trim());
