      case '性与生殖健康':
        return 'data:image/svg+xml;base64,';
    }
  }

  const calculateCharCount = function(text) {
    if (!text) {
      return 0; // 如果 text 为 undefined 或 null，则返回 0
    }
    // 计算文本中的字符数，可以根据实际需要进行调整
    return text.length;
  }

  const baseHeight = 35 // 基础高度
  const tailHeight = ref(0) // 底部高度
  const buttonHeight = ref(0) // 底部按钮高度
  const labelHeight = ref(0) // 便签延伸高度
  const calculateTopPosition = function(idx) {
    // 当前段行数  
    const Lines = ref(0) // 累计行数
    for (let i = 0; i < idx; i++)
      Lines.value += Math.ceil(calculateCharCount(paragraphs.value[i]) / 22);
    tailHeight.value = baseHeight + (Lines.value + Math.ceil(calculateCharCount(paragraphs.value[idx]) / 22)) * 3
    buttonHeight.value = tailHeight.value + 5
    labelHeight.value = (Lines.value + Math.ceil(calculateCharCount(paragraphs.value[idx]) / 22)) * 3
    return baseHeight + Lines.value * 3; // 计算垂直位置
  }

  const calculateTopPositionShare = function(idx) {
    const Lines = ref(0) // 累计行数
    for (let i = 0; i < idx; i++)
      Lines.value += Math.ceil(calculateCharCount(paragraphs.value[i]) / 22);
    if (Lines.value + Math.ceil(calculateCharCount(paragraphs.value[idx]) / 22) >= 18) return -100;
    return baseHeight + 2 + Lines.value * 2.5;
  }

